/* eslint-disable jsx-a11y/alt-text */
/* eslint-disable jsx-a11y/no-redundant-roles */
/* eslint-disable jsx-a11y/anchor-is-valid */
import React from "react";

const Premium = () => (
  <div className="bg-white shadow-md rounded-md p-2 mt-4">
    <p className="text-center">Go to premium</p>
    <img src="https://img.lovepik.com/png/20231008/cute-crown-yellow-metal-cartoon-crown-an-crown-gold-crown_131776_wh1200.png" />

    <h1 className="text-lg font-semibold">Need more features?</h1>
    <p className=" text-sm font-medium text-gray-500 w-[240px] ">
      Update your account to premium to get more features.
    </p>
    <a
      href="#"
      className=" mt-3 flex w-full items-center justify-center rounded-md text-white bg-sky-500 px-3 py-2 text-sm font-semibold text-gray-900 shadow-sm ring-1 ring-inset ring-gray-300 hover:bg-gray-50 focus-visible:outline-offset-0"
    >
      Get now
    </a>
  </div>
);

export default Premium;
